// SPDX-License-Identifier: MIT
pragma solidity >=0.4.22 <0.9.0;

pragma experimental ABIEncoderV2;

contract SupplyChain {
    address public Owner;

    constructor() public {
        Owner = msg.sender;
    }

    modifier onlyByOwner() {
        require(msg.sender == Owner);
        _;
    }

    enum STAGE {
        Init,
        RawMaterialSupply,
        Manufacture,
        Distribution,
        Retail,
        Sold
    }

    uint256 public medicineCtr = 0;
    uint256 public rmsCtr = 0;
    uint256 public manCtr = 0;
    uint256 public disCtr = 0;
    uint256 public retCtr = 0;

    struct medicineBasic {
        uint256 id;
        string name;
        string description;
        uint256 RMSid;
        uint256 MANid;
        uint256 DISid;
        uint256 RETid;
        address receiver;
        STAGE stage;
    }

    struct medicineDetails {
        uint256 quantity;
        uint256 price;
        uint256 manufacturingDate;
        uint256 expiryDate;
    }

    mapping(uint256 => medicineBasic) public MedicineStockBasic;
    mapping(uint256 => medicineDetails) public MedicineStockDetails;
    mapping(uint256 => ProcessingEntry[]) public MedicineProcessingHistory;

    struct rawMaterialSupplier {
        address addr;
        uint256 id;
        string name;
        string place;
    }

    mapping(uint256 => rawMaterialSupplier) public RMS;

    struct manufacturer {
        address addr;
        uint256 id;
        string name;
        string place;
    }

    mapping(uint256 => manufacturer) public MAN;

    struct distributor {
        address addr;
        uint256 id;
        string name;
        string place;
    }

    mapping(uint256 => distributor) public DIS;

    struct retailer {
        address addr;
        uint256 id;
        string name;
        string place;
    }

    mapping(uint256 => retailer) public RET;

    struct ProcessingEntry {
        address user;
        STAGE stage;
        uint256 timestamp;
        address receiver;
        uint256 quantity;
    }

    function showStage(uint256 _medicineID) public view returns (string memory) {
        require(medicineCtr > 0);
        if (MedicineStockBasic[_medicineID].stage == STAGE.Init) {
            return "Medicine Ordered";
        }
        if (MedicineStockBasic[_medicineID].stage == STAGE.RawMaterialSupply) {
            return "Raw Material Supply Stage";
        }
        if (MedicineStockBasic[_medicineID].stage == STAGE.Manufacture) {
            return "Manufacturing Stage";
        }
        if (MedicineStockBasic[_medicineID].stage == STAGE.Distribution) {
            return "Distribution Stage";
        }
        if (MedicineStockBasic[_medicineID].stage == STAGE.Retail) {
            return "Retail Stage";
        }
        if (MedicineStockBasic[_medicineID].stage == STAGE.Sold) {
            return "Medicine Sold";
        }
    }

function getManufacturerMedicine(address _manufacturer) public view returns (uint256[] memory, uint256[] memory) {
    uint256[] memory medicineList = new uint256[](medicineCtr);
    uint256[] memory soldMedicineList = new uint256[](medicineCtr);
    uint256 medicineCount = 0;
    uint256 soldMedicineCount = 0;

    for (uint256 i = 1; i <= medicineCtr; i++) {
        if (MedicineStockBasic[i].MANid != 0 && MAN[MedicineStockBasic[i].MANid].addr == _manufacturer) {
            medicineList[medicineCount] = i;
            medicineCount++;
        }
        if (MedicineStockBasic[i].MANid != 0 && MAN[MedicineStockBasic[i].MANid].addr == _manufacturer && MedicineStockBasic[i].stage == STAGE.Sold) {
            soldMedicineList[soldMedicineCount] = i;
            soldMedicineCount++;
        }
    }

    // Resize the arrays to the actual counts
    assembly {
        mstore(medicineList, medicineCount)
        mstore(soldMedicineList, soldMedicineCount)
    }

    return (medicineList, soldMedicineList);
}


    function getDistributorMedicine(address _distributor) public view returns (uint256[] memory, uint256[] memory) {
    uint256[] memory medicineList = new uint256[](medicineCtr);
    uint256[] memory soldMedicineList = new uint256[](medicineCtr);
    uint256 medicineCount = 0;
    uint256 soldMedicineCount = 0;

    for (uint256 i = 1; i <= medicineCtr; i++) {
        if (MedicineStockBasic[i].DISid != 0 && DIS[MedicineStockBasic[i].DISid].addr == _distributor) {
            medicineList[medicineCount] = i;
            medicineCount++;
        }
        if (MedicineStockBasic[i].DISid != 0 && DIS[MedicineStockBasic[i].DISid].addr == _distributor && MedicineStockBasic[i].stage == STAGE.Sold) {
            soldMedicineList[soldMedicineCount] = i;
            soldMedicineCount++;
        }
    }

    // Resize the arrays to the actual counts
    assembly {
        mstore(medicineList, medicineCount)
        mstore(soldMedicineList, soldMedicineCount)
    }

    return (medicineList, soldMedicineList);
}

    function getRetailerMedicine(address _retailer) public view returns (uint256[] memory, uint256[] memory) {
    uint256[] memory medicineList = new uint256[](medicineCtr);
    uint256[] memory soldMedicineList = new uint256[](medicineCtr);
    uint256 medicineCount = 0;
    uint256 soldMedicineCount = 0;

    for (uint256 i = 1; i <= medicineCtr; i++) {
        if (MedicineStockBasic[i].RETid != 0 && RET[MedicineStockBasic[i].RETid].addr == _retailer) {
            medicineList[medicineCount] = i;
            medicineCount++;
        }
        if (MedicineStockBasic[i].RETid != 0 && RET[MedicineStockBasic[i].RETid].addr == _retailer && MedicineStockBasic[i].stage == STAGE.Sold) {
            soldMedicineList[soldMedicineCount] = i;
            soldMedicineCount++;
        }
    }

    // Resize the arrays to the actual counts
    assembly {
        mstore(medicineList, medicineCount)
        mstore(soldMedicineList, soldMedicineCount)
    }

    return (medicineList, soldMedicineList);
}
    function getMedicineDetails(uint256 _medicineID) public view returns (
        string memory name,
        string memory description,
        uint256 quantity,
        uint256 price,
        uint256 manufacturingDate,
        uint256 expiryDate,
        string memory currentStage
    ) {
        require(_medicineID > 0 && _medicineID <= medicineCtr);
        name = MedicineStockBasic[_medicineID].name;
        description = MedicineStockBasic[_medicineID].description;
        quantity = MedicineStockDetails[_medicineID].quantity;
        price = MedicineStockDetails[_medicineID].price;
        manufacturingDate = MedicineStockDetails[_medicineID].manufacturingDate;
        expiryDate = MedicineStockDetails[_medicineID].expiryDate;
        currentStage = showStage(_medicineID);
    }

    function addRMS(address _address, string memory _name, string memory _place) public onlyByOwner() {
        rmsCtr++;
        RMS[rmsCtr] = rawMaterialSupplier(_address, rmsCtr, _name, _place);
    }

    function addManufacturer(address _address, string memory _name, string memory _place) public onlyByOwner() {
        manCtr++;
        MAN[manCtr] = manufacturer(_address, manCtr, _name, _place);
    }

    function addDistributor(address _address, string memory _name, string memory _place) public onlyByOwner() {
        disCtr++;
        DIS[disCtr] = distributor(_address, disCtr, _name, _place);
    }

    function addRetailer(address _address, string memory _name, string memory _place) public onlyByOwner() {
        retCtr++;
        RET[retCtr] = retailer(_address, retCtr, _name, _place);
    }

    function RMSsupply(uint256 _medicineID, address _receiver,uint256 _quantity) public {
        require(_medicineID > 0 && _medicineID <= medicineCtr);
        uint256 _id = findRMS(msg.sender);
        require(_id > 0);
        require(MedicineStockBasic[_medicineID].stage == STAGE.Init);
        MedicineStockBasic[_medicineID].RMSid = _id;
        MedicineStockBasic[_medicineID].receiver = _receiver;
        MedicineStockBasic[_medicineID].stage = STAGE.RawMaterialSupply;
        MedicineProcessingHistory[_medicineID].push(
            ProcessingEntry(msg.sender, STAGE.RawMaterialSupply, block.timestamp, _receiver,_quantity)
        );
    }

    function findRMS(address _address) private view returns (uint256) {
        require(rmsCtr > 0);
        for (uint256 i = 1; i <= rmsCtr; i++) {
            if (RMS[i].addr == _address) return RMS[i].id;
        }
        return 0;
    }

    function Manufacturing(uint256 _medicineID, address _receiver,uint256 _quantity) public {
        require(_medicineID > 0 && _medicineID <= medicineCtr);
        uint256 _id = findMAN(msg.sender);
        require(_id > 0);
        require(MedicineStockBasic[_medicineID].stage == STAGE.RawMaterialSupply);
        MedicineStockBasic[_medicineID].MANid = _id;
        MedicineStockBasic[_medicineID].receiver = _receiver;
        MedicineStockBasic[_medicineID].stage = STAGE.Manufacture;
        MedicineProcessingHistory[_medicineID].push(
            ProcessingEntry(msg.sender, STAGE.Manufacture, block.timestamp, _receiver, _quantity)
        );
    }

    function findMAN(address _address) private view returns (uint256) {
        require(manCtr > 0);
        for (uint256 i = 1; i <= manCtr; i++) {
            if (MAN[i].addr == _address) return MAN[i].id;
        }
        return 0;
    }

    function Distribute(uint256 _medicineID, address _receiver,uint256 _quantity) public {
        require(_medicineID > 0 && _medicineID <= medicineCtr);
        uint256 _id = findDIS(msg.sender);
        require(_id > 0);
        require(MedicineStockBasic[_medicineID].stage == STAGE.Manufacture);
        MedicineStockBasic[_medicineID].DISid = _id;
        MedicineStockBasic[_medicineID].receiver = _receiver;
        MedicineStockBasic[_medicineID].stage = STAGE.Distribution;
        MedicineProcessingHistory[_medicineID].push(
            ProcessingEntry(msg.sender, STAGE.Distribution, block.timestamp, _receiver , _quantity)
        );
    }

    function findDIS(address _address) private view returns (uint256) {
        require(disCtr > 0);
        for (uint256 i = 1; i <= disCtr; i++) {
            if (DIS[i].addr == _address) return DIS[i].id;
        }
        return 0;
    }

    function Retail(uint256 _medicineID, address _receiver,uint256 _quantity) public {
        require(_medicineID > 0 && _medicineID <= medicineCtr);
        uint256 _id = findRET(msg.sender);
        require(_id > 0);
        require(MedicineStockBasic[_medicineID].stage == STAGE.Distribution);
        MedicineStockBasic[_medicineID].RETid = _id;
        MedicineStockBasic[_medicineID].receiver = _receiver;
        MedicineStockBasic[_medicineID].stage = STAGE.Retail;
        MedicineProcessingHistory[_medicineID].push(
            ProcessingEntry(msg.sender, STAGE.Retail, block.timestamp, _receiver, _quantity)
        );
    }

    function findRET(address _address) private view returns (uint256) {
        require(retCtr > 0);
        for (uint256 i = 1; i <= retCtr; i++) {
            if (RET[i].addr == _address) return RET[i].id;
        }
        return 0;
    }

    function sold(uint256 _medicineID,uint256 _quantity) public {
        require(_medicineID > 0 && _medicineID <= medicineCtr);
        uint256 _id = findRET(msg.sender);
        require(_id > 0);
        require(_id == MedicineStockBasic[_medicineID].RETid);
        require(MedicineStockBasic[_medicineID].stage == STAGE.Retail);
        MedicineStockBasic[_medicineID].stage = STAGE.Sold;
        MedicineProcessingHistory[_medicineID].push(
            ProcessingEntry(msg.sender, STAGE.Sold, block.timestamp, address(0), _quantity)
        );
    }

    function addMedicine(
        string memory _name,
        string memory _description,
        uint256 _quantity,
        uint256 _price,
        uint256 _manufacturingDate,
        uint256 _expiryDate
    ) public onlyByOwner() {
        require((rmsCtr > 0) && (manCtr > 0) && (disCtr > 0) && (retCtr > 0));
        medicineCtr++;
        MedicineStockBasic[medicineCtr] = medicineBasic(
            medicineCtr,
            _name,
            _description,
            0,
            0,
            0,
            0,
            address(0),
            STAGE.Init
        );
        MedicineStockDetails[medicineCtr] = medicineDetails(
            _quantity,
            _price,
            _manufacturingDate,
            _expiryDate
        );
        MedicineProcessingHistory[medicineCtr].push(
            ProcessingEntry(msg.sender, STAGE.Init, block.timestamp, address(0), _quantity)
        );
    }

    function getMedicineProcessingHistory(uint256 _medicineID) public view returns (ProcessingEntry[] memory) {
        require(_medicineID > 0 && _medicineID <= medicineCtr);
        return MedicineProcessingHistory[_medicineID];
    }
}
